const Par = () => (
<svg viewBox="0 0 100 25"> 
	<circle className="fill-1" cx="40%" cy="50%" r="5" fill="gray"/>
	<rect x="40" y="10" width="20%" height="10%" fill="pink"/>
</svg> 
)
export default Par
